import { gql } from '@apollo/client'
const SIGNUP = gql`
mutation Signup (
    $email: String!
    $password: String!
    $name: String!
){
    signup(
        email: $email
        password: $password
        username: $name
    ){
        token
    }
}
`;

const LOGIN = gql`
mutation Login(
    $email: String!
    $password: String!
){
    login(email: $email, password: $password){
        token
    }
}
`;
export {SIGNUP, LOGIN }
